import Header from "../components/Header";

function Projects() {
  return (
    <div>
      <Header />
      <h1>Descrição projeto 1</h1>
      <img src="img-projeto1" />
      <img src="img-projeto1" />
      <img src="img-projeto1" />

      <h1>Descrição projeto 2</h1>
      <img src="img-projeto2" />
      <img src="img-projeto2" />
      <img src="img-projeto2" />

      <h1>Descrição projeto 3</h1>
      <img src="img-projeto3" />
      <img src="img-projeto3" />
      <img src="img-projeto3" />
    </div>
  );
}

export default Projects;
